import {Link} from 'react-router-dom'
function Navbar() {

    return(
        <div>
            <section>
               <Link to='/create'>UserSignupForm</Link>
               <Link to='/c'>EventCreateForm</Link>
            </section>
        </div>
    )
}
export default Navbar;
